INSERT INTO `app_blog` VALUES (8,'Carta a ejecutivos de venta','<p>Instructivo para ejecutivos de venta</p>\r\n</br></br>\r\nCARTA A EJECUTIVOS DE VENTA REQUERIDO  EN EL PROYECTO UVAs.\r\n </br></br>\r\n\r\nCon todo el respecto que se merece el personal que quiere ser partícipes del presente proyecto quiero manifestar lo siguiente como parte del lineamiento general de la filosofía que requerimos para continuar adelante con la iniciativa:\r\n </br></br>\r\ndespués de estudiar con cuidado las condiciones en que nos encontramos hoy como consecuencia de haber sido deslumbrados por una economía asesina que nos ahoga y no permite que se obtengan mayores logros por estar limitados ante las condiciones que impongan los dueños del capital he llegado a la conclusión de que una buena forma de avanzar hacia nuevas y prosperas situaciones es poder lograr construir UNA NUEVA FUERZA ECONÓMICA independiente de las ya existentes que pueda crear opciones propias y determinadas por el principio de la SOLIDARIDAD.\r\n </br></br>\r\nPara lograr este objetivo la empresa ha generado el banco de proyectos que hoy tenemos a disposición en el proyecto UVAs.\r\n </br></br>\r\nsu objetivo es respaldar el fortalecimiento de EL HOLDING FINANCIERO EMPRESARIAL SOLIDARIO que sea ampliamente avalado por la mayor cantidad de participantes posible.\r\n </br></br>\r\nesto es concebible y perfectamente lograble si logramos hacernos comprender de una gran cantidad de personas, para ello es imprescindible hacer entender que se trata de unir esfuerzo social direccionado a constituir un GRAN CAPITAL de soporte que permita ejecutar en la práctica los proyectos dispuestos para su realización, esto con el fin de abrir las puertas de la PROSPERIDAD COLECTIVA.\r\n </br></br>\r\n¿Qué ocurre en la actualidad?\r\n </br></br>\r\nunos pocos líderes empresariales son los dueños de todo el sistema productivo y esto implica que las utilidades de los negocios sean únicamente para un reducido número de personas y eso está bien ya que el esfuerzo de ellos se ve compensado y no importa la cantidad de personas que estén involucradas en ese proceso ya que estos se lucran de su actividad y resuelven así su cuestión de supervivencia.\r\n </br></br>\r\nno hay nada que reprocharles ya que así funciona la cosa en la actualidad y existe un bienestar del cual todos disfrutamos hoy, lo que sucede es que ESTE SISTEMA ESTA SATURADO Y FULL, cosa que no permite el surgimiento de otras alternativas ya que tiene suficiente tarea y no les alcanza el tiempo para crear otras circunstancias que permitan enganchar en su maquinaria al personal que hoy está vacante y sin empleo...\r\n </br></br>\r\nes por ese motivo que yo quiero apelar AL CRITERIO DE LA SOLIDARIDAD como fuente de riqueza inagotable.\r\n</br></br>\r\nque se entienda que es imprescindible hacer uso de ESTE ACTIVO SOCIAL, Para poder despegar hacia otros horizontes.\r\n</br></br>\r\npermitir que se entienda que la compra de LOS TÍTULOS DE INVERSIÓN EMPRESARIAL, no son propiamente para obtener grandes utilidades individuales sino UNA GRAN OPORTUNIDAD PARA GENERAR RIQUEZA SOCIAL, que quiere decir oportunidad de empleo para los millones de personas que hoy carecen de el ya que no hay donde colocarlos en acción.\r\n</br></br>\r\nEntender que una participación eficiente y comprometida con el proyecto claramente definido como el que presentamos crea las condiciones requeridas para que se vean en la práctica resultados eficientes que dan una esperanza a la cantidad de personas que se encuentran si ningún futuro ...\r\n</br></br>\r\nes muy difícil adquirir la fortuna suficiente que permita una influencia notable en el entorno desde una sola persona, pero si es posible que entendiendo claramente lo que es UN APORTE SOLIDARIO que sume con otros muchos IGUALMENTE SOLIDARIOS si se puede llegar a acumular con UNA GRAN SOLIDARIDAD de participantes un GRAN CAPITAL que represente el esfuerzo de una comunidad FUERTE Y PARTICIPATIVA.\r\n</br></br>\r\n  AL ASOCIAR EN UNA GRAN CUENTA las participaciones DE LOS TÍTULOS DE INVERSIÓN EMPRESARIAL, genera UNA GRAN FUERZA ECONÓMICA, las grandes corporaciones que dominan hoy el medio productivo también están sustentadas por miles de participantes que tiene acciones en dichas corporaciones...a eso quiero apelar con el planteamiento dispuesto.\r\n</br></br>\r\nA el apoyo colectivo.\r\n</br></br>\r\nal querer de muchos en un mismo objetivo encaminar la SOLIDARIDAD a la compra de TÍTULOS DE INVERSIÓN EMPRESARIAL, respaldados por la voluntad de crear nuevas perspectivas de organización social que permitan el enlace de NUEVOS NÚCLEOS de producción producto de la suma de muchos participantes que lleven en su fondo el sello de la SOLIDARIDAD.\r\n</br></br>','blogs/1500x844_ejecutivos_exito.jpg','2020-03-26 20:04:09','2020-03-28 00:49:23','carta-ejecutivos-de-venta',3,0,NULL,0),(9,'COVID-19: LA TRANSFORMACION DE LOS NEGOCIOS AL MUNDO ONLINE','El nuevo escenario instalado por el avance del coronavirus en los últimos días, ha dejado a un gran número de empresas en jaque para continuar con sus actividades.\r\n<br>\r\nAnte esta realidad muchas de ellas se están planteando o han optado ya por potenciar el canal digital que parece ser de los pocos que queda a salvo de contagio del COVID19.  Así, se ponen en marcha diferentes modelos de negocio que tendrán internet y el mundo on line como principal canal para poder desarrollar actividades profesionales y rentabilizarlas sin restricciones.\r\n<br>\r\nPero, ¿cómo de sencillo es poner en marcha este tipo de medidas digitales? ¿Basta con diseñar, desarrollar y lanzar un e-commerce, una App o cualquier otro tipo de entorno digital para ofrecer productos o servicios? En efecto esto es requisito indispensable, pero también lo será que estos portales o plataformas digitales cumplan con la normativa vigente teniendo que estar debidamente legalizadas.\r\n<br>\r\n¿Cómo puedo saber si mi negocio o plataforma digital cumple la Ley y está a salvo de incurrir en problemas con los usuarios o consumidores?  Pues bien, todas ellas tendrán que ser previamente analizadas y estudiadas para poder redactar unos textos legales diseñados a medida que garanticen que cumplimos con nuestras obligaciones como empresarios, así como ofrecer las garantías y la seguridad necesarias a nuestro cliente final.\r\n<br>\r\nEn función del tipo de plataforma digital de que se trate, será de vital importancia tener unas buenas condiciones generales de contratación ya que constituirán el contrato de compraventa de los productos o servicios con nuestros clientes, así como el desarrollo de unas licencias de uso detalladas en el caso de las Apps o SaaS.\r\n<br>\r\nY por último la privacidad de los datos personales que recabamos a través de este tipo de plataformas que hará imprescindible tener una política de privacidad alineada con el resto de medidas jurídicas adoptadas por la empresa en esta materia.\r\n<br>\r\nLa diferencia entre lanzar nuestros negocios online sin priorizar o pensar en estas cuestiones es la de salir al mercado bajo una vulnerabilidad frente a posibles reclamaciones de los usuarios o exponernos a multas por parte de las autoridades de control correspondientes. Pero más allá de esto hay que entender que, la legalización de este tipo de negocios con rigor, es una ventaja competitiva frente a empresas competidoras, ya que se ofrecen muchas más garantías de seguridad y cumplimiento.\r\n<br>\r\nCumplir la ley es una garantía y un valor añadido para tus clientes, mejora tu posicionamiento en el mercado y tu Reputación Online y, por tanto, incrementa las ventas.\r\n<br>\r\nSin duda, pensar en estos momentos en la trasformación de los negocios hacia el mundo online es una oportunidad de sobrevivir a esta crisis.  Igual de importante es lanzar este tipo de iniciativas como si de otro negocio offline se tratase teniendo en cuenta cuáles son nuestras obligaciones como empresario y saliendo al mercado con los deberes hechos y las espaldas cubiertas para garantizarnos absoluta tranquilidad y profesionalidad.','blogs/covid19.jpg','2020-04-11 07:03:37','2020-04-11 07:03:44','covid-19-la-transformacion-de-los-negocios-al-mund',4,0,NULL,0),(10,'Emprender una marca \"Social\" puede transormar tu negocio','<p>Desarrollar una campaña de marketing digital para aumentar el branding de tu negocio en linea puede ser una tarea sencilla si cuentas con las redes sociales adecuadas para difundir el mensaje de tus productos y/o servicios.</p><p>&nbsp;</p><p>Construir la imagén empresarial, desarrollar contenido, estremecer al publico objetivo con las claves que en tu modelo de negocio cobran vida y aumentando la capacidad de ventas de la marca para interactuar adecuadamente en redes será la clave para deconstruir la marca y emprenderla online.</p><p>&nbsp;</p><p>Queremos decir con esto que la capacidad de ventas online estará anidada en su forma concreta como un todo no alejado de las espectativas humanas y cada vez más sociales y a mayor velocidad.</p><p>&nbsp;</p><blockquote><p>Capturar en imagenes la trama de un producto y lograr generar confianza o engagement en la forma, color, perspectiva y metodologia con la que los usuarios logran el embudo de conversión quiere decir difundir una marca en redes sociales.</p></blockquote><p>&nbsp;</p><p>Empresas como Facebook, Google, Instagram, Twitter, Pinterest, Youtube, Vimeo, Flicker, 500px, Snapchat, Tic toe o incluso tu propia red comercial en Linkedin, pueden lograr atracción precisa para generar un publico objetivo que impacte en tu sistema de negocios.</p><p>&nbsp;</p><p>Lograr interactuar con este publico en redes puede desenmascarar una serie de oportunidades que deben ser aprovechadas en el momento oportuno.</p><p>&nbsp;</p><p><strong>Herramientas de Google</strong> podrán ayudarnos a medir con eficacia cuantos usuarios estan convirtiendo para tu red.</p><p>&nbsp;</p><p>Insistir en un stack técnológico que consolide a tu equipo de trabajo dependerá de la rapidez con que la red asuma que tu contenido es relevante para el publico que requieres y deseas atraer.</p><p>&nbsp;</p><p><i>Emprender una marca “Social” Puede transformar tu negocio.</i></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>','blogs/social-code.png','2020-04-13 21:44:49','2020-04-13 21:47:13','emprender-una-marca-social-puede-transormar-tu-neg',4,0,NULL,0),(11,'Crear un Canvas de Modelos de negocios Social es una clave para el emprendimiento online que mejorará tu visión ejecutiva','<blockquote><p>El canvas de emprendiento social es una herramienta diseñada por Ginés Haro para ayudar a emprendedores sociales a entender y desarrollar mejores modelos de negocio.</p></blockquote><p>&nbsp;</p><h2>La parte más difícil de comenzar es comenzar. En la creación de un CANVAS , estarás inmerso en el entorno ideal para que ocurra la magia de inicio.</h2><p><strong>– Objetivo:</strong> Define qué pretendes conseguir con tu modelo de emprendimiento social, así como cualquier aspecto clave relacionado con el propósito y la visión del proyecto.</p><p>&nbsp;</p><p><strong>– Impacto: </strong>Define tu impacto social y medioambiental, así como los beneficios en cada aspecto. Es importante que incluyas las métricas base que utilizarás para medir los resultados y que te servirán para evaluar si estás consiguiendo el cambio que te propusistes con tu emprendimiento social.</p><p>&nbsp;</p><p><strong>– Segmentos:&nbsp;</strong>Define cláramente quienes son tus clientes y beneficiarios ¿Es el mismo colectivo o diferente? ¿Quién es la persona u organización que paga por tu servicio o producto? ¿Quién lo recibe?</p><p>&nbsp;</p><p><strong>– Problema: </strong>¿cuál es el principal problema al que dará solución tu propuesta? Ten en cuenta que hay problemas específicos, a los que se enfrentan los clientes y/o beneficiarios que no son los generales que se podrían plantear en la sección Objetivo. Indica también qué alternativas hay ¿Qué otros proyectos o empresas tienen tus segmentos como opción? ¿Cómo se resuelven actualmente esos problemas?</p><p>&nbsp;</p><p><strong>– Propuesta de valor:&nbsp;</strong>Que propuesta elimina o mejora los problemas descritos para clientes y beneficiarios. Qué obtiene el cliente que paga por tu producto o servicio. Qué obtienen los beneficiarios.</p><p>&nbsp;</p><p><strong>– Solución y actividades clave:</strong>&nbsp; Qué solución llevará la propuesta de valor a los segmentes. Qué actividades, productos y/o servicios tienes que realizar para implementar tu propuesta de valor.</p><p>&nbsp;</p><p><strong>– Recursos, socios y actores clave: </strong>¿A quién necesitas movilizar para que tu modelo de negocio funcione?&nbsp; Qué recursos son necesarios para ejecutar tus actividades clave: permisos, financiación, herramientas… ¿Qué grupos, personas, empresas u organizaciones necesitas involucrar en tu emprendimiento social?</p><p>&nbsp;</p><p><strong>– Canales: </strong>¿Cómo te comunicas con tus clientes y beneficiarios? ¿Cómo entregas tu producto/servicio de emprendimiento social? ¿Cómo vas a llegar a los clientes y/o beneficiarios de una manera escalable?</p><p>&nbsp;</p><p><strong>– Ventaja Diferencial:&nbsp; </strong>¿Por qué tendrá éxito este proyecto de emprendimiento social? ¿Qué hace de tu proyecto algo único que tu competencia no podrá copiar?</p><p>&nbsp;</p><p><strong>– Ingresos: </strong>¿Cuáles son tus vías de ingresos? ¿Que productos y servicios vas a ofrecer por los que otros van a pagar?</p><p>&nbsp;</p><p><strong>– Surplus: </strong>¿Qué vas a hacer con los beneficios de tu emprendimiento social? ¿Dónde y cómo los vas a invertir?</p><p>&nbsp;</p><p><strong>– Estructura de costes:&nbsp;</strong>Los conceptos más importantes de gasto e inversión ¿Cómo vambian conforme escalas?</p><p>&nbsp;</p><p>Aprenda lo que realmente se necesita para comenzar una empresa.</p><p>&nbsp;</p><p>Ningún libro, panel, orador o publicación de blog le enseñará lo que necesita saber pero si tendrá las bases para establecerlo, adémas contar con el equipo con el cual practicar es esencial.</p><p>&nbsp;</p><p>La única forma de aprender es la experiencia de intentarlo.</p><p>&nbsp;</p><p><i><strong>Crear un Canvas de Modelos de negocios Social es una clave para el emprendimiento online que mejorará tu visión ejecutiva.</strong></i></p>','blogs/canvasmetodologia.png','2020-04-13 23:15:03','2020-04-13 23:15:03','crear-un-canvas-de-modelos-de-negocios-social-es-u',4,0,NULL,0),(12,'Tarjeta Inkacoin es lanzada para USA y Colombia','<p>La fuerza del modelo online impulsa el lanzamiento de la nueva billetera Inkacoin. Una tarjeta virtual que permite a los usuarios adquirir Inkacoin de forma inmediata.</p>','blogs/Screenshot_20200413-183523.png','2020-04-13 23:43:19','2020-04-13 23:45:17','tarjeta-inkacoin-es-lanzada-en-protection-uvas',2,0,NULL,0),(13,'5 formas de utilizar la plataforma de Proyecto Uvas para generar ingresos online','<p>Ya ingresaste en Proyecto Uvas, una vez hayas terminado de crear tu cuenta en nuestra sección “Crear Cuenta” te redirigirás a nuestro DASHBOARD o página de inicio donde cuentas con un perfil en nuestra red. Felicitaciones, ya eres parte de Proyecto Uvas, es hora de poner manos a la obra y empezar a generar acciones que se conviertan en una verdadera ayuda internacional y fuerza de cambio.&nbsp;</p><p>&nbsp;</p><p>Notarás que hemos creado una Tarjeta electrónica Inkacoin personalizada que puedes recargar y utilizar para no tener que usar papel moneda, sigue leyendo y te contaremos más sobre como usar INKACOIN. Por ahora puedes comenzar seleccionando una de las 5 opciones que hemos preparado para ti y podrás comenzar a generar ingresos online desde tu hogar estés donde estés.</p><p>&nbsp;</p><p>Para comenzar con cada una de las opciones puedes comunicarte a nuestros números telefónicos via WhatsApp o llamando al (+57) 3192121193 o (+57) 3196753725 desde cualquier parte del mundo y directamente te guiaremos paso a paso. Entre los países desde los cuales puedes iniciar ya se encuentran: Colombia, Venezuela, Ecuador, Argentina, México, Estados Unidos, España, Italia, El Salvador, Uruguay, Costa Rica, Panamá, República dominicana, Suecia, Honduras, Chile, Bolivia, Canadá, Francia y Finlandia. Si tu país no se encuentra en la lista, escríbenos y te incluiremos lo antes posible.</p><p>&nbsp;</p><p><strong>1. Comercialización de títulos empresariales:</strong></p><p>Selecciona el modelo empresarial que deseas adquirir entre los 50 títulos que tenemos para ti. Comienza a comercializar con ellos aumentando tus niveles de ingreso gracias a nuestro modelo de mercadeo para Holding empresarial. Pregunta por costos y porcentajes de ganancias, obtén una capacitación con nuestros asesores en Bogotá y crece tu red.</p><p>&nbsp;</p><p><strong>2. Invierte en Inkacoin:</strong></p><p>EL Inkacoin es la moneda digital emergente de Colombia, un activo en crecimiento que está cambiando la forma en que las personas adquieren productos &nbsp;y servicios en Internet. Invertir en Inkacoins significa potenciar una nueva fuerza económica que no solo transformará tu economía, también estarás contribuyendo a mejorar el mercado Latinoamericano generando valor agregado a el gran esquema de inversión comunitaria internacional.</p><p>&nbsp;</p><p><strong>3. Teletrabaja desde casa:</strong></p><p>Genera ingresos adicionales desde tu hogar y #QuedateEnCasa trabajando para Proyecto Uvas como teletrabajo. Escríbenos en www.facebook.com/ProyectoUvas y te decimos como o envía un mensaje a nuestro numero en Whatsapp (+57) 3192121193. También puedes dirigirte a nuestra oficina en la ciudad de Bogotá en la dirección Cl 18#4-85. Oficina 103. con atención a Sr. Nelson Echeverry. No te preocupes si estás en otro lugar del mundo, la comunicación será 100% online.</p><p>&nbsp;</p><p><strong>4. Mejora tus habilidades profesionales con nuestro programa de estudios:</strong></p><p>Ser mejor cada día en nuestros trabajos es esencial para mantener nuestro nivel profesional o encontrar el trabajo que siempre has deseado, incluso emprender tu propio negocio. Toma uno de nuestros cursos presencial o de forma online entre los que podrás seleccionar o crear un plan de estudios avanzados con nuestro curso ejecutivo de alto nivel para visionarios, o nuestro curso de negocios online y marketing digital en el cual aprenderás a construir un negocio digital y posicionar con técnicas de marketing.&nbsp;</p><p>&nbsp;</p><p>Los cursos están disponibles para emprendedores, estudiantes universitarios, adultos y personas que desean aprender a usar internet para generar ingresos. En el curso de Diseño para la Web aprenderemos a diseñar y mejorar una marca desde cero para luego utilizar todas las herramientas en linea y consolidar tu proyecto. Todos los cursos son dictados por profesionales en el sector y puedes empezar ahora mismo con la ventaja de obtener asesoría y guía personalizada incluso en tu domicilio.</p><p>&nbsp;</p><p><strong>5. Crea una tienda online:</strong></p><p>Te ayudamos a vender en Internet con nuestro programa de creación y difusión de tiendas y productos online. Si tienes una idea de negocio o ya estás vendiendo en un local comercial, puedes ampliar tu clientela gracias a nuestro programa en el cual te guiaremos paso a paso en la creación de tu tienda online, conectarla con nuestra plataforma de pagos, publicitar en Google Ads, Facebook Ads, Instagram e incluso utilizando técnicas de Marketing Outbound. Tenemos la solución perfecta para tu negocio. Comienza a vender ahora.</p><p>&nbsp;</p><p><strong>También puedes contribuir con la Plataforma:</strong></p><p>Si deseas contribuir con Proyecto Uvas puedes realizar donaciones en nuestra pagina www.proyectouvas.com/donaciones y ser parte de esta fuerza de cambio mundial. Con esto asegurarás estar al tanto de todos nuestros proyectos de los cuales tu puedes participar activamente y convertirte en líder.</p><p>&nbsp;</p><p><strong>Comparte tu experiencia:</strong></p><p>Si deseas compartir tu experiencia con visionarios que ya se encuentran desarrollando negocios online, accede con tu cuenta y ve a la sección “Crear Audio”. Allí podrás grabar y compartir tus audios con nuestra red de empresarios y solucionar dudas o realizar tu aporte social. Estamos para escucharte. Recuerda que esta herramienta esta creada para ti y usarla significa impulsarnos a mejorarla, todos te lo agradeceremos. En nuestra Tienda podrás encontrar libros y productos que pueden guiarte en este camino. Cuentas con nosotros.</p><p>&nbsp;</p><p>Equipo Proyecto Uvas.</p><p>www.proyectouvas.com</p><p>info@proyectouvas.com</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>','blogs/acciones.png','2020-04-15 08:23:25','2020-04-15 08:23:25','5-formas-de-utilizar-la-plataforma-de-proyecto-uva',4,0,NULL,0),(14,'El diseño de la World Wide Web y su futuro dentro de la experiencia de usuario. Una visión conceptual.','<p><i>El crecimiento de la World Wide Web</i> o el uso de tecnologías online cuando hablamos de internet ha desembocado en una nueva era digital donde la red ha pasado de ser una herramienta de entretenimiento para convertirse en esencia del que hacer diario donde su uso es requisito para completar tareas cotidianas, desde comunicarnos, recibir información relevante hasta acceder a servicios y mercados emergentes que complementan modelos sociales.<strong> Hablamos de \"teletrabajo\", “compras online”, “comunicación e interacción humana”, “aprendizaje online”, “gobierno en linea”, “dinero digital”, y un sin fin de aplicaciones que ademas de crear verdadero impacto sobre el planeta, dejaron de convertirse en “juegos online” y “bibliotecas virtuales” para transformarse en eje fundamental de un mundo cada vez mas globalizado.</strong></p><p>&nbsp;</p><p>Esto &nbsp;no quiere decir que el internet como ventana de información y sus aplicaciones tradicionales hayan dejado de existir, al contrario, se han vuelto más fuertes; los medios tradicionales como prensa, radio y televisión, se han fusionado en este nuevo mundo donde la industria del entretenimiento se fortalece pero al mismo &nbsp;tiempo crea un publico cada vez más exigente debido a la gran cantidad y flujo de información, sin tomar en cuenta la velocidad de esta y hace consistente una interactividad que más que ser digital se fortalece y nos envuelve en una especie de <i>“realidad virtual”.</i></p><p>&nbsp;</p><p>El modelo de negocio digital depende principalmente de Internet y sin este, toda la infraestructura decaería a una sociedad-no-digital o más bien retrocederíamos en el tiempo hacia “un mundo sin electricidad”, tan radical es el cambio como la analogía de pensar en que tener el control de este “salto en el tiempo” significa apoderarse de un nuevo modelo social, entre quienes adopten el cambio y quienes no.</p><p>&nbsp;</p><p>Empresas , pequeñas y grandes corporaciones se han tomado esto muy en serio al punto de adherir este agregado “tecnológico” a todas sus implementaciones de negocio y llamar a esto <strong>&lt;&lt;Productos Inteligentes&gt;&gt;</strong>, como autos inteligentes, sistemas inteligentes, compras inteligentes, hogares con artefactos inteligentes, relojes inteligentes e incluso hablamos de mercados inteligentes y todo lo que pueda integrarse electrónicamente a una fuente de energía eléctrica + internet.</p><p>&nbsp;</p><p>La forma en que las personas utilizamos estos nuevos artefactos de la era electrónica nos conduce a interactuar en mayor o menor escala con el mundo digital para poder acceder a las oportunidades que esto conlleva como sociedad, la forma en que interactuamos con este gran robot o cerebro digital, diseñado para obtener información humana y proveer los mejores resultados a quienes hacen uso de la tecnología en red vuelve trascendente no solo el diseño lógico detrás del computo de aquellos que crean toda la lógica de las funciones de esta red en si. La mejora vendrá a medida que su diseño sea cada vez más eficiente para los usuarios y los usuarios se apropien más de esta tecnología literalmente, \"necesaria\".</p><p>&nbsp;</p><blockquote><p>Pero, ¿Qué nos espera el futuro cuando hablamos de la World Wide Web como escenario principal de este planeta cambiante?</p></blockquote><p>&nbsp;</p><p><i><strong>Develando el escenario transitorio entre un mundo sin internet y un mundo casi en su totalidad conectado</strong></i>, nos encontramos con la denominación que prepara el nuevo modelo<strong> “La red social”</strong>, refiriéndonos a esta no como una página en internet donde comienza todo, mas bien como elemento teórico de lo que viene a llamarse un modelo de negocios internacional mezclado con un modelo de negocios que en la practica podríamos denominar social e incluso evolutivo.</p><p>&nbsp;</p><p>Partiendo de la comunicación con limites podemos llegar a una comunicación sin limites donde el factor de interacción puede reaccionar en el transcurso de este aprendizaje para desencadenar el sutil y atómico híbrido nacido entre el ser humano, su contenedor geográfico y una maquina que cada minuto se vuelve más poderosa hasta otorgarnos el poder de volver a transformar la era otorgándonos nuevas y más grandes experiencias.</p><p>&nbsp;</p><blockquote><p>Será importante para todos, maquinas, humanos o no, conocer el diseño original de la gran red y fundirnos en sus posibilidades.</p></blockquote><p>&nbsp;</p><p>&nbsp;</p>','blogs/react.png','2020-04-21 06:09:58','2020-04-21 06:09:58','el-diseno-de-la-world-wide-web-y-su-futuro-dentro-',3,0,NULL,0),(16,'Invertir en Inkacoin como plataforma mundial de negocios.','<p>La transformación hacia la era digital abre las posibilidades a muchas formas de nuevos negocios en el mundo online. Inkacoin como moneda de cambio virtual viene a impactar en un mercado en crecimiento que establece un nuevo modelo comercial en Colombia.</p><p>&nbsp;</p><p>Es esta nueva economía un alivio para pequeños y grandes inversores que además de contribuir al modelo en crecimiento aumenta las posibilidades para que personas de todo el mundo puedan adquirir nuevos productos y servicios &nbsp;gracias a la plataforma que Inkacoin con su tarjeta de adquisición <i>Wallet IKC</i> nos ofrece.&nbsp;</p><p>&nbsp;</p><p><i><strong>Proyecto Uvas</strong></i> &nbsp;como precursor de esta alternativa no solamente nos incentiva a integrarnos a un mundo colaborativo, en resumén nos habilita para construir en conjunto un abanico de posibilidades donde productores en todas las áreas trabajan en conjunto para fortalecer Inkacoin.</p><p>&nbsp;</p><blockquote><p>Invertir en Inkacoin es la mejor forma de utilizar esta plataforma para obtener beneficios a corto y largo plazo donde el país y el continente entero atraviesa una transformación hacia lo digital, donde ya somos parte.</p></blockquote><p>&nbsp;</p><p>COMPRA INKACOINS Y FORMA PARTE DE NUESTRA COMUNIDAD VIRTUAL Y JUNTOS HAGAMOS ALGO IMPORTANTE POR EL PLANETA.</p>','blogs/proyectouvasinkacoin.png','2020-06-09 01:46:50','2020-06-09 02:05:28','invertir-en-inkacoin-es-una-plataforma-myundial-de',2,0,NULL,0);
